import { ThemeProvider as MuiThemeProvider } from "@material-ui/core/styles";

export class SignUp extends Component {
  continue = (e) => {
    e.preventDefault();
    this.props.nextStep();
  };

  render() {
    const { values, handleChange } = this.props;
    return (
      <MuiThemeProvider>
        <></>
      </MuiThemeProvider>
    );
  }
}

export default SignUp;
